	add("ariel", "{\"term\":\"ariel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From Biblical Hebrew \u0027אֲרִיאֵל\u0027 a compound of \u0027אֲרִי\u0027 and \u0027אֵל\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A name for the city of Jerusalem\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Woe to \u0027\u0027Ariel\u0027\u0027, to \u0027\u0027Ariel\u0027\u0027, the city where David dwelt! add ye year to year; let them kill sacrifices\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"also ascribed to spirits and angels in English literature\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Then sent I for Eliezer, for \u0027\u0027Ariel\u0027\u0027, for Shemaiah, and for Elnathan, and for Jarib, and for Elnathan, and for Nathan, and for Zechariah, and for Meshullam, chief men; also for Joiarib, and for Elnathan, men of understanding\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Scene 2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"All hail, great master! grave sir, hail! I come / To answer thy best pleasure; be\u0027t to fly, / To swim, to dive into the fire, to ride / On the curl\u0027d clouds; to thy strong bidding task / \u0027\u0027Ariel\u0027\u0027 and all his quality\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1667\u0027\u0027 w:John John Milton, \u0027s:Paradise Lost (1667)/Book Paradise Lost/Book VI\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Nor stood unmindful Abdiel to annoy / The Atheist crew, but with redoubl’d blow / \u0027\u0027Ariel\u0027\u0027 and Arioc, and the violence / Of Ramiel scorcht and blasted overthrew\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1714\u0027\u0027 w:Alexander Alexander Pope, \u0027s:The Rape of the The Rape of the Lock\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Of these am I, who thy Protection claim, / A watchful Sprite, and \u0027\u0027Ariel\u0027\u0027 is my Name\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 w:Phyllis Phyllis Chesler, \u0027With Child\u0027, Crowell, ISBN 0690018355, page 121\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"You don\u0027t look like a Daniel (your pre-chosen name). There\u0027s something fierce and tawny about you. You\u0027re the Lion! You\u0027re \u0027\u0027Ariel\u0027\u0027: God\u0027s Lion. You\u0027ll be my father Leon\u0027s namesake — and for \u0027your\u0027 father, you\u0027ll have a Hebrew name\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"I dub thee \u0027\u0027Ariel\u0027\u0027, faery spirit of my tempest. You\u0027ll be my Jerusalem\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"used mainly since the 1980s\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027 Kristina Logan, \u0027The Right Man for Loving\u0027, Thorndike Press, ISBN 1560545380, page 190\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"quot;I\u0027m going to name her \u0027\u0027Ariel\u0027\u0027,\u0026quot; Laura said, ignoring them completely as she stared down at the baby. \u0026quot;The boys like the name because it\u0027s the same as the girl in the \u0027Little Mermaid\u0027 movie. And I like it, because it\u0027s pretty.\u0026quot\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Name of the twelfth and brightest moon of the planet Uranus\", \"priority\":17}]}, \"synonyms\":{}}");

