	add("arity", "{\"term\":\"arity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{suffix|lang\u003den|-ary|ity}}. Compare {{m|en|adicity}} and {{m|en|adinity}}, based on the corresponding Greek root.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The number of arguments or operands a function or operation takes. For a relation, the number of domains in the corresponding Cartesian product\", \"priority\":1}]}, \"synonyms\":{}}");

	add("arithmancy", "{\"term\":\"arithmancy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ἀριθμός\u0027 (number) {{suffix||mancy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Divination using numbers that are the equivalent of letters of a nam\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Of this roote last spoken of [sc. astrology], springs innumerable branches; such as the knowledge of natiuities; the Chiromancie, Geomantie, Hydromantie, Arithmantie, Physiognomie: \u0026amp; a thousand others: which were much practiced, \u0026amp; holden in great reuerence by the Gentiles of olde.\u0026quot; -- \u0027King James Daemonologie, 1597\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Divination by means of numbers. The Greeks examined the number and value of the letters in the names of two combatants, and predicted that he whose name contained most letters, or letters of the greatest value, would be the victor.\u0026quot; -- \u0027Encyc. Occult, L. Spence, 1920\", \"priority\":3}]}, \"synonyms\":{}}");

	add("arithmetic", "{\"term\":\"arithmetic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027arsmetike\u0027 from Old french (842-ca. 1400) \u0027arismetique\u0027 from Latin \u0027arithmetica\u0027 from Ancient Greek \u0027sc\u003dpolytonic|ἀριθμητική\u0027 (counting) (\u0027sc\u003dpolytonic|τέχνη\u0027 (art) , from \u0027sc\u003dpolytonic|ἀριθμός\u0027 (number) Used in English since 13th Century.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The mathematics of numbers (integers, rational numbers, real numbers, or complex numbers) under the operations of addition, subtraction, multiplication, and division\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21581981-what-pollution-some-opportunity-others-welcome-plastisphere Welcome to the passage\u003d[The researchers] noticed many of their pieces of [plastic marine] debris sported surface pits around two microns across.Closer examination showed that some of these pits did, indeed, contain bacteria, and that in several cases these bacteria were dividing and thus, by the perverse \u0027\u0027arithmetic\u0027\u0027 of biological terminology, multiplying\", \"priority\":2}]}, \"synonyms\":{}}");

