	add("arizona", "{\"term\":\"arizona\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Basque\", \"tohono o\u0027odham\"], \"text\":\"Uncertain. Two very different origins have been proposed:* From Basque {{m|eu||aritz ona|good oak}}, from {{m|eu|aritz||oak}} + {{m|eu|ona||good}}.* From Tohono o\u0027odham {{m|ood||alĭ ṣonak|small spring}}, from {{m|ood|alĭ||small}} {{m|ood|ṣonak||spring}}.The claim that it comes from Spanish {{m|es|árida||dry}} and {{m|es|zona||zone}} is folk etymology.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of the United States of America. Postal code: AZ, capital: Phoenix\", \"priority\":1}]}, \"synonyms\":{}}");

